def knightDialer(n):
    mod = 10 ** 9 - 7
    moves = [[4, 6], [6, 8], [7, 9], [4, 8], [0, 3, 9], [], [0, 1, 7], [2, 6], [1, 3], [2, 4]]
    dp = [[0] * 10 for _ in range(n)]
    for i in range(10):
        dp[0][i] = 1
    for i in range(1, n):
        for j in range(10):
            for k in moves[j]:
                dp[i][j] += dp[i - 1][k]
                dp[i][j] %= mod
    return sum(dp[-1]) % mod

